function [Rrs412, aph, adg, ad, ag] = save_model(test_Rrs, test_lambda)
% ***********************************************************************
% Derive Aph and Acdom from Landsat-8 Rrs measurements
% INPUTS:
%       test_Rrs:        matrix of Landsat-8 Rrs spectra, each row representing an individual spectrum at four visible bands;%       
%       test_lambda:     [443 482 561 655]
% OUTPUT:
%       Rrs412:    Estimated Rrs(412) from Landsat-8's Rrs spectra
%          aph:    Spectral aph, at 412, 443, 482, 561, 655
%          adg:    Spectral adg,...
%           ad:    Spectral ad, ...
%           ag:    Spectral ag, ..
% Sub-functions:
%       virtual_band_estimator, standard_Rrs_class, iop_model
%
% *********************************************************************
% created September 24, 2018
% Jianwei Wei, University of Massachusetts Boston
%


%%%% estimate Rrs412
Rrs412 = virtual_band_estimator(test_Rrs, test_lambda);

%%%% derive IOPs
newRrs = [Rrs412, test_Rrs];
[aph, adg, ad, ag] = iop_model(newRrs, [412, test_lambda]);

end




%% Virtual-band estimator
function Rrs412 = virtual_band_estimator(test_Rrs, test_lambda)
% Estimate Rrs(412) from Landsat-8's Rrs(443), Rrs(482), Rrs(561) and Rrs(655);   
% INPUTS:
%       test_Rrs:        matrix of Landsat-8 Rrs spectra, each row representing an individual spectrum at four visible bands;%       
%       test_lambda:     [    443 482 561 655]
% OUTPUT:
%       Rrs412:     estimated Rrs(412) from Landsat-8's Rrs spectra
% *****************************************************************************************
% Jianwei Wei, University of Massachusetts Boston
% Jianwei.Wei@umb.edu,
% http://oceanoptics.umb.edu
% Sept-06-2018
%%% standard Rrs class

[ref_nRrs, ref_lambda] = standard_Rrs_class();


% keep the original value
test_Rrs_orig = test_Rrs;

[refRow,refCol]=size(ref_nRrs);

%% normalization
[inRow, inCol] = size(test_Rrs);

% transform spectrum to column, inCol*inRow
test_Rrs = test_Rrs';
test_Rrs_orig = test_Rrs_orig';

% inCol*inRow
nRrs_denom=sqrt(nansum(test_Rrs.^2));
nRrs_denom = repmat(nRrs_denom,[inCol,1]);
nRrs = test_Rrs./nRrs_denom;  

% SAM input, inCol*inRow*refRow 
test_Rrs2 = repmat(test_Rrs_orig,[1,1,refRow]);

%for ref Rrs, inCol*refRow*inRow 
test_Rrs2p = permute(test_Rrs2,[1,3,2]);

% inCol*inRow*refRow  
nRrs2_denom=sqrt(nansum(test_Rrs2.^2));
nRrs2_denom = repmat(nRrs2_denom,[inCol,1]);
nRrs2 = test_Rrs2./nRrs2_denom;  
% inCol*refRow*inRow  
nRrs2 = permute(nRrs2,[1,3,2]);



%%
ref_nRrs2 = ref_nRrs(:,2:5)';

% inCol*refRow*inRow 
ref_nRrs2 = repmat(ref_nRrs2,[1,1,inRow]);


%% Classification 
%%%% calculate the Spectral angle mapper
% inCol*refRow*inRow 
cos_denom=sqrt(nansum(ref_nRrs2.^2).*nansum(nRrs2.^2));
cos_denom = repmat(cos_denom,[inCol,1]);
cos = (ref_nRrs2.*nRrs2)./cos_denom; 
% 1*refRow*inRow 
cos = sum(cos);
% refRow*inRow
cos = permute(cos,[2,3,1]);

% 1*inRow
[maxCos,clusterID] = max(cos);
posClusterID = isnan(maxCos);


%% derive Rrs412

ref_nRrs3 = ref_nRrs(clusterID,:);
ref_nRrs3 = ref_nRrs3';

Rrs412(:,1) = sqrt(nansum(test_Rrs.^2).*ref_nRrs3(1,:).^2./(1-ref_nRrs3(1,:).^2));



end


%% iop_model for Aph & Acdom from Rrs(412,443,482,561,655)
function [aph, adg, ad,  ag] = iop_model(Rrs, wl)
% Qusi-analytic algorithm for an extended Landsat-8/OLI, or LandsatX
% NOTE:
%      This Matlab routine is suitable for Rrs with OLI's orignal
%      bandpass, such as those processed by Acolite, and those with 
%      adjusted nominal bandpass of 11 nm such as those processed by
%      SeaDAS; for latter, you must assign "bandpass = 11".
%
% Inputs:
%   wl = [412 443 482 561 655];
% Outputs:
%
% Citation: Lee et al.(2002),App Opt;
%           Lee (2014),IOCCG webpage; 
%           Lee et al.(2016),RSE;
%
% created Oct-11-2016;
% upated March-2-2017; added "bandpass", to deal with the "adjusted nominal
%                      bandpass (11 nm) for SeaDAS outputs.
% updated Aug-28-2018; added aph and adg estimation
%


% ******************** search & matchup ***********************************
id412 = find(abs(wl-412)==min(abs(wl-412)));   % Band 0: 412nm
id443 = find(abs(wl-443)==min(abs(wl-443)));   % Band 1: 443nm
id490 = find(abs(wl-482)==min(abs(wl-482)));   % Band 2: 482nm 
id555 = find(abs(wl-561)==min(abs(wl-561)));   % Band 3: 561nm
id670 = find(abs(wl-670)==min(abs(wl-670)));   % Band 4: 655nm


%%%% replace Rrs(670) with Rrs(655), by Wei. 
% Rrs(:,id670) = Rrs(:,id670)*0.762-0.0000826;   % based on all measurements
% Rrs(id670) = Rrs(id670)*0.853-0.0000305;    % based on deep-water data only
% Rrs(:,id670) = 0.6931 * (Rrs(:,id670)).^0.9727;   % based all in situ and Simu data, R^2 = 0.99
% Rrs(:,id670) = 0.7364 * (Rrs(:,id670)).^0.9718;   % based all in situ , R^2 = 0.99


%%%% adjust bandwidth effects: 561 nm
Rrs(:,id490) = Rrs(:,id490) * 1.036 + 2.552e-5;
Rrs(:,id555) = Rrs(:,id555) * 1.073 - 8.399e-5;
Rrs(:,id670) = 0.7494 * (Rrs(:,id670)).^0.9854;   % based all in situ , R^2 = 0.99

aw  = [0.0031    0.0049    0.0132    0.0623    0.4390];   % [412 443 490 561 670], bandwidth 15 nm, Lee et al(2015)
bbw = [ 0.0033    0.0024    0.0016    0.0009    0.0004];


% % ******************** aw & bbw, refer to Lee et al.(2016), RSE;
% % *********** Wide Width ************
% aw  = [0.0046, 0.005 ,  0.011,  0.064,  0.368];       % these constants are provided by Lee et al.(2016)
% bbw = [0.0033, 0.0021, 0.0014, 0.0008, 0.0004];



% ******************** QAA Step 1
rrs = Rrs./(0.52+1.7*Rrs);

g0 = 0.089;
g1 = 0.125;
u  = (-g0 + (g0^2 + 4*g1*rrs).^0.5)/(2*g1);


%%%% Step 2
idx = find(Rrs(:, id670) < 0.0015);
if ~isempty(idx)    
    wl_ref(idx,1) = wl(id555);
    id_ref(idx) = id555;
    
    %%%%  
    ki = log10((rrs(:,id443)+rrs(:,id490))./(rrs(:,id555) + 5*rrs(:,id670).*rrs(:,id670)./rrs(:,id490)));
    a_ref(idx,1) = aw(id555) + 10.^(-1.146 - 1.366 * ki(idx) - 0.469*ki(idx).^2);
    
    %%%% Step 3
    bbp_ref(idx,1) = u(idx,id555).*a_ref(idx)./(1-u(idx,id555)) - bbw(id555);  


end
idx = find(Rrs(:, id670) >= 0.0015);
if ~isempty(idx)
    wl_ref(idx,1) = 670;
    id_ref(idx) = id670;
    a_ref(idx) = aw(id670) + 0.39 * (rrs(idx,id670)./(rrs(idx,id443) + rrs(idx,id490))).^1.14;
    
    %%%% Step 3
    bbp_ref(idx,1) = u(idx,id670).*a_ref(idx)./(1-u(idx,id670)) - bbw(id670); 
    
end
idx = find(isnan(Rrs(:,id670)));
if ~isempty(idx)
    wl_ref(idx,1) = 670;
    id_ref(idx) = id670;
    a_ref(idx) = NaN;
    
    %%%% Step 3
    bbp_ref(idx,1) = NaN;     
end

%%%% Step 4
Y = 2.0*(1-1.2*exp(-0.9*rrs(:,id443)./rrs(:,id555)));

%%%% Step 5 & Step 6
for i = 1 : length(wl)
   bbp(:,i) = bbp_ref .*(wl_ref/wl(i)).^Y;
   a(:,i)   = (1-u(:,i)).*(bbw(i) + bbp(:,i))./u(:,i);      
end
bb = bbp + repmat(bbw, [size(a,1), 1]);


apg = a - repmat(aw, [size(a,1), 1]); %h2o_iops(wl,'a');



%%%% Step 7  (an empirical relationship)
zeta = 0.74 + 0.2 ./ (0.8 + rrs(:,id443)./rrs(:,id555));  % zeta = a_ph(410)/a_ph(440);

%%%% Step 8
S  = 0.015 + 0.002./(0.6+rrs(:,id443)./rrs(:,id555));
xi = exp(S*(443-412));                              % xi = ag(410)/ag(440);

%%%% Step 9
adg443 = (a(:,id412)-zeta.*a(:,id443))./(xi-zeta) - (aw(id412) - zeta*aw(id443))./(xi-zeta);
for i = 1 : length(wl)
    adg(:,i)    = adg443 .* exp(-S.*(wl(i) - 443));
end

%%%% Step 10
aph = apg - adg;


%%%% new: separate ad and ag (the following is based on Dong et al.(2013))
sigma = 0.05 * apg(:,id443) + bbp(:,id555) .* 1.4.^((rrs(:,id555)+rrs(:,id670))./rrs(:,id443));
ad443 = 0.6 * sigma.^0.9;
for i = 1 : length(wl)
    ad(:,i) = ad443 .* exp(-0.012*(wl(i) - 443));
end

ag = adg - ad;


end



